#include <stdint.h>
#include <stdio.h>
#include <stdlib.h>
typedef uint64_t ui;

void print_tab(ui* tab, int n) {
    if (n == 0) {
        printf("[]\n");
        return;
    }

    printf("[ ");
    for (int i = 0; i < n-1; i++) {
        printf("%lu, ", tab[i]);
    }
    printf("%lu ]\n", tab[n-1]);
}

void print_tab2(int* tab, int n) {
    if (n == 0) {
        printf("[]\n");
        return;
    }

    printf("[ ");
    for (int i = 0; i < n-1; i++) {
        printf("%d, ", tab[i]);
    }
    printf("%d ]\n", tab[n-1]);
}

const int base = 16;
const int p = 4;
// `p` represents the number of bits used
// for representing a number of the base
// Should be (int)log2(base)

// Question 4
void copy(ui* in, ui* out, int n) {
    for (int i = 0; i < n; i++) out[i] = in[i];
}

// Question 5
void zero(int* tab, int n) {
    for (int i = 0; i < n; i++) tab[i] = 0;
}

// Question 6
ui get_digit(ui x, int k) {
    unsigned left = sizeof(ui)*8 - (k+1)*p;
    unsigned right = k*p;
    return x << left >> (left + right);
}
ui get_digit_based(ui x, int k, int p) {
    unsigned left = sizeof(ui)*8 - (k+1)*p;
    unsigned right = k*p;
    return x << left >> (left + right);
}

// Question 7
int* histogram(ui* in, int n, int k) { // O(n)
    int* hist = calloc(base, sizeof(int));
    for (int i = 0; i < n; i++) hist[get_digit(in[i], k)]++;
    return hist;
}

// Quesiton 8
int* prefix_sums(int* hist) { // O(base)
    int* sums = malloc(base * sizeof(int));
    int sum = 0;
    for (int i = 0; i < base; i++) {
        sums[i] = sum;
        sum += hist[i];
    }
    return sums;
}

// Quesiton 9
void radix_sort(ui* tab, int n) { // O(n + (8*w / p) * (3n + base))
    ui* out = malloc(sizeof(ui) * n);
    copy(tab, out, n); // O(n)

    int nb_passes = 8*sizeof(ui) / p;
    for (int k = 0; k < nb_passes; k++) {  // O((8*w / p) * (3n + base))
        int* hist = histogram(out, n, k);  // O(n)
        int* sums = prefix_sums(hist);     // O(base)
        ui* temp = malloc(sizeof(ui) * n);

        for (int i = 0; i < n; i++) {      // O(n)
            int c = get_digit(out[i], k);
            temp[sums[c]] = out[i];
            sums[c]++;
        }

        copy(temp, out, n); // O(n)
        free(temp);
        free(hist);
        free(sums);
    }

    print_tab(out, n);
    free(out);
}

